import React from "react"

const ChildDataKaryawan = (props) => {
    return (
        <div>
            {
                props.data.map((i, key) => {
                    return (
                        <p>
                        <h5>No:{i+1}</h5>
                        <h5>EmpId:{key.emp_id}</h5>
                        <br/>
                        </p>
                            )
                        })
        
        }  
    </div >
  )
};

export default ChildDataKaryawan;
